import { useState } from 'react';
import Head from 'next/head';
import Link from 'next/link';

export default function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Login attempt:', { email, password });
    alert('Login functionality not implemented in this demo.');
  };

  return (
    <div className="container">
      <Head>
        <title>Login - Expense Manager</title>
        <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css" rel="stylesheet" />
      </Head>

      <div className="min-vh-100 d-flex align-items-center justify-content-center bg-gradient">
        <div className="card shadow-lg" style={{ width: '100%', maxWidth: '400px' }}>
          <div className="card-body">
            <h2 className="card-title text-center mb-4 text-pink">Login to Expense Manager</h2>
            <form onSubmit={handleSubmit}>
              <div className="mb-3">
                <label htmlFor="email" className="form-label">Email</label>
                <input
                  type="email"
                  className="form-control"
                  id="email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                />
              </div>
              <div className="mb-3">
                <label htmlFor="password" className="form-label">Password</label>
                <input
                  type="password"
                  className="form-control"
                  id="password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
              </div>
              <button type="submit" className="btn btn-pink w-100 mb-3">Log in</button>
            </form>
            <p className="text-center">
              Don't have an account? <Link href="/register" className="text-pink">Register here</Link>
            </p>
          </div>
        </div>
      </div>

      <style jsx global>{`
        body {
          margin: 0;
          padding: 0;
          font-family: Arial, sans-serif;
        }
        .bg-gradient {
          background: linear-gradient(135deg, #FFC0CB, #FFB6C1, #FF69B4);
        }
        .text-pink {
          color: #FF1493;
        }
        .btn-pink {
          background-color: #FF1493;
          border-color: #FF1493;
          color: white;
        }
        .btn-pink:hover {
          background-color: #FF69B4;
          border-color: #FF69B4;
        }
        .card {
          border-radius: 15px;
          border: none;
        }
        .form-control:focus {
          border-color: #FF69B4;
          box-shadow: 0 0 0 0.2rem rgba(255, 105, 180, 0.25);
        }
        a {
          color: #FF1493;
          text-decoration: none;
        }
        a:hover {
          color: #FF69B4;
          text-decoration: underline;
        }
      `}</style>
    </div>
  );
}
